import React from "react"
function MyInfo(){
    return(
        <div>
            <h1>bob ziroll</h1>
            <p>this is a paragraph about me</p>
            <ul>
                <li>thailand</li>
                <li>japan</li>
                <li>bangkok</li>
            </ul>

        </div>
    )
}
export default MyInfo;
